import { faThumbsUp,faThumbsDown, faClock,faPlusSquare,faCheck } from '@fortawesome/free-solid-svg-icons'


export function font(){
    return (<FontAwesomeIcon className='cursor' icon={{...icon}}  size='lg' color='black' />);
}
